import styled from 'styled-components';

const Content = styled.div`
	text-align: center;
`;

const Header = () => <>Шапка страницы</>;
const Footer = () => <>Подвал страницы</>;

export const Blog = () => {
	return (
		<>
			<Header />
			<Content>
				<h2>Заголовок страницы</h2>
			</Content>
			<Footer />
		</>
	);
};
